import { theme } from "@chakra-ui/core";
import { customIcons } from "./lib/icons";

export const bgColor = { light: "white", dark: "gray.800" };
export const color = { light: "gray.800", dark: "gray.100" };

export default {
  ...theme,
  icons: {
    ...theme.icons,
    ...customIcons,
  },
};
